import React from 'react';

const ContactUS = () => {
  return (
    <div>
      <h1>Contact Us</h1>
      <p>Contact iLogicPlus Solutions at +91 6238 870 610 or info@ilogicplus.com</p>
    </div>
  );
};

export default ContactUS;
